import React, { useState } from 'react';
import PageHeading from './PageHeading';
import classes from './AddQuestion.module.css'

type FormData = {
    question: string;
    type: string;
  }

const AddQuestion: React.FC = () => {

    const submitHandler = (e: React.FormEvent<HTMLFormElement>): void => {
        console.log("clicked", e.currentTarget.value);
      }

    const onchangeHandler = (e: React.ChangeEvent<HTMLFormElement>): void => {
        console.log(e.currentTarget.value);
    }

    return (
        <div>
            <PageHeading
                pageTitle="Add a question"
            />
            <div className={classes.top}>
                <div className={classes.maincontent}>
                <form method="POST">
                        <label>
                            Question:
                            <input type="text" name="question" onChange={(e) => {onchangeHandler(e)}} />
                        </label>
                        <label>
                            Type:
                            <input type="text" name="type"  onChange={(e) => {onchangeHandler(e)}}/>
                        </label>
                        <button type="submit" onClick={(e) => {submitHandler(e)}}>Submit</button>
                    </form>
                </div>
        </div>
    </div>
    );
};

export default AddQuestion;
